import React from "react";
import { Section } from "./Section";
import styled from "styled-components";
import { Column, Row } from "./App";

const AboutColumn = styled(Column)`
	justify-content: center;
	background: rgb(255, 255, 255, 0.3);
	border: 1px solid #a9ffcb;
`;
const LeftColumn = styled(AboutColumn)`
	flex: 40%;
`;
const RightColumn = styled(AboutColumn)`
	flex: 60%;
`;

export function About() {
	return (
		<Section title="About">
			<Row>
				<LeftColumn>headshot here then school logo</LeftColumn>
				<RightColumn>
					<div>
						<h1>Contact</h1>
						<p>isf4rjk@virginia.edu</p>
						<p>(508) 507-1856</p>
						<p>Greater Boston Area</p>
					</div>
					<div>
						<h1>Education</h1>
						<p>University of Virgina, Charlottesville, VA</p>
						<i>2020-2024</i>
						<p>Bachelor of Science in Computer Science</p>
					</div>
					<div></div>
				</RightColumn>
			</Row>
		</Section>
	);
}
